import React, { Component } from 'react'
import {InfoConsumer} from '../Context';


function Home(){
    return (
        <InfoConsumer>
            {
                data => {
                    return <h2>{data}</h2>;
                }
            }
            </InfoConsumer>
        );
}
export default Home;
